import React from 'react';
import styled from 'styled-components';
import { popularproduct } from '../items';
import Product from './product';


const Container=styled.div`
  display:flex; 
  width:100vw;
`

function Products(){
    return (
        <Container>
           {popularproduct.map(item=>{
            return (
                <Product item={item} />

            )
           })} 
        </Container>
    )
}
export default Products;
